webpackJsonp([0xf927f8900006],{288:function(e,n){e.exports={data:{site:{siteMetadata:{title:"Annalisa Valente"}},contentfulPageSelectorPanel:{pages:[{name:"Macmillan Cancer Support",title:null,slug:"/projects/brave-the-shave/",description:"Redesigning Brave the Shave microsite"},{name:"Google",title:"Google",slug:"/projects/google/",description:"Interaction designer contractor in the Google Play Console team"},{name:"The Telegraph",title:"The Telegraph",slug:"/projects/the-telegraph/",description:"Working on various digital newspaper touch points"},{name:"Nectar ",title:"Nectar",slug:"/projects/nectar/",description:"  New way of discovering Nectar brands for web and iOS-Android "},{name:"Local Cancer Intelligence",title:"Local Cancer Intelligence",slug:"/projects/local-cancer-intelligence/",description:"New filter system for the LCI website"},{name:"The Telegraph Puzzle ",title:null,slug:"/projects/the-telegraph-puzzle/",description:"Redesign the experience of the Telegraph Puzzle website"},{name:"RememberÂ names",title:null,slug:"/projects/face-name/",description:"Concept of an Android experience that helps to match faces to names"},{name:"MyMail & Nectar",title:"MyMail & Nectar",slug:"/projects/mymail-and-nectar/",description:"Launch of MyMail and Nectar proposition"},{name:"Mindfulness Moments",title:"Mindfulness Moments",slug:"/projects/mindfulness-moments/",description:"Building a new fundraising proposition"},{name:"Mighty hikes",title:null,slug:"/projects/mighty-hikes",description:"Building a new fundraising proposition"},{name:"Calvin Klein",title:"Calvin Klein",slug:"/projects/calvin-klein/",description:"Designing microsite for Calvin Klein Italy"},{name:"Emoji and depression",title:null,slug:"/projects/emoji-and-depression",description:"Detect depression in young people "}]},contentfulPage:{slug:"/about/",password:null,panels:[{__typename:"ContentfulImagePanel",fullWidth:!1,media:{description:"Testing description",file:{url:"//images.ctfassets.net/wk0hltq7eofw/6dUxyw49e8mOWoOQowguMs/ae00e95fd027f57a2109de7c1142ed38/IMG_2320.jpg"}}},{__typename:"ContentfulContentPanel",content:{content:'## I\'ve had the pleasure to work on cool projects with numbers of globally great brands in UK, Italy and Canada\n\n__Key points of my design experience:__\n\n- I use a design thinking approach, always user first\n- I have web and Mobile experience\n- I work with stakeholders, eng, PO and marketers. When it is possible, I like to pair with developers\n- I\'m able to organise design sprints and workshops in order to identify design opportunities\n- I like to help the team to identify technical and design constrains at the very beginning\n- My design decisions are data driven \n- I believe that communication and decision making are the key to making a great team and to build great products\n- I have a high value for openness, humility, flexibility, collaboration, diversity and empathy\n\n__What I think about design__\n\nI think the designer today has an enormous responsability in the world.\nFor this purpose I share the vision of good design with <a href="https://www.interaction-design.org/literature/article/dieter-rams-10-timeless-commandments-for-good-design" target="_blank" title="External link to Interaction Design">Dieter Rams</a> that says:\n\n1) Good design is innovative\n2) Good design makes a product useful\n3) Good design is aesthetic\n4) Good design makes a product understandable\n5) Good design is unobtrusive\n6) Good design is honest\n7) Good design is long-lasting\n8) Good design is thorough down to the last detail\n9) Good design is environmentally friendly\n10) Good design involves as little design as possible\nAdding:\n*11) Good design is accessible*\n\n__My outside work interests:__\n\nIn my free time I like playing D&D, board games and learning drums.\n\nI am a member of the Jury at <a href="https://www.cssdesignawards.com/" target="_blank" title="External link to CSS Design Awards">www.cssdesignawards.com</a> and sometimes I like to write articles and to participate at hackathons. \nI\'m also helping at the <a href="https://uxpa-uk.org/" target="_blank" title="External link to UXPA UK">UXPA UK</a> as a Event Support Lead.\n',childMarkdownRemark:{html:'<h2>I\'ve had the pleasure to work on cool projects with numbers of globally great brands in UK, Italy and Canada</h2>\n<p><strong>Key points of my design experience:</strong></p>\n<ul>\n<li>I use a design thinking approach, always user first</li>\n<li>I have web and Mobile experience</li>\n<li>I work with stakeholders, eng, PO and marketers. When it is possible, I like to pair with developers</li>\n<li>I\'m able to organise design sprints and workshops in order to identify design opportunities</li>\n<li>I like to help the team to identify technical and design constrains at the very beginning</li>\n<li>My design decisions are data driven </li>\n<li>I believe that communication and decision making are the key to making a great team and to build great products</li>\n<li>I have a high value for openness, humility, flexibility, collaboration, diversity and empathy</li>\n</ul>\n<p><strong>What I think about design</strong></p>\n<p>I think the designer today has an enormous responsability in the world.\nFor this purpose I share the vision of good design with <a href="https://www.interaction-design.org/literature/article/dieter-rams-10-timeless-commandments-for-good-design" target="_blank" title="External link to Interaction Design">Dieter Rams</a> that says:</p>\n<ol>\n<li>Good design is innovative</li>\n<li>Good design makes a product useful</li>\n<li>Good design is aesthetic</li>\n<li>Good design makes a product understandable</li>\n<li>Good design is unobtrusive</li>\n<li>Good design is honest</li>\n<li>Good design is long-lasting</li>\n<li>Good design is thorough down to the last detail</li>\n<li>Good design is environmentally friendly</li>\n<li>Good design involves as little design as possible\nAdding:\n<em>11) Good design is accessible</em></li>\n</ol>\n<p><strong>My outside work interests:</strong></p>\n<p>In my free time I like playing D&#x26;D, board games and learning drums.</p>\n<p>I am a member of the Jury at <a href="https://www.cssdesignawards.com/" target="_blank" title="External link to CSS Design Awards">www.cssdesignawards.com</a> and sometimes I like to write articles and to participate at hackathons.\nI\'m also helping at the <a href="https://uxpa-uk.org/" target="_blank" title="External link to UXPA UK">UXPA UK</a> as a Event Support Lead.</p>'}}}]}},pathContext:{slug:"/about/",p:"35675e68f4b5af7b995d9205ad0fc43842f16450"}}}});
